%[text]{"align":"center"} ##  $\\begin{array}{l}\n\\textrm{BE}\\;\\textrm{Systèmes}\\;\\textrm{multi}-\\textrm{dimensionnels}\\\\\n\n\\end{array}${"editStyle":"visual"} 
