%[text] ## **Analysis of the natural system**
%[text] 
%[text] $\\dot{x} =\\left\\lbrack \\begin{array}{cccc}\na\_{11}  & a\_{12}  & 0 & a\_{14} \\\\\na\_{21}  & a\_{22}  & 0 & a\_{24} \\\\\n1 & 0 & 0 & a\_{34} \\\\\n0 & 1 & 0 & 0\n\\end{array}\\right\\rbrack x+\\left\\lbrack \\begin{array}{cc}\nb\_{11}  & b\_{12} \\\\\nb\_{21}  & b\_{22} \\\\\n0 & 0\\\\\n0 & 0\n\\end{array}\\right\\rbrack u${"editStyle":"visual"} et $y=\\left\\lbrack \\begin{array}{cccc}\n0 & 0 & 1 & 0\\\\\n0 & 0 & 0 & 1\n\\end{array}\\right\\rbrack x\\;${"editStyle":"visual"}
%[text] $y=\\left\\lbrack \\begin{array}{c}\nh\\\\\n\\theta \n\\end{array}\\right\\rbrack =\\left\\lbrack \\begin{array}{c}\n\\textrm{profondeur}\\;\\textrm{du}\\;\\textrm{sousmarin}\\\\\n\\;\\textrm{angle}\\;\\textrm{de}\\;\\textrm{tangage}\n\\end{array}\\right\\rbrack ;\\;\\;\\;\\;u=\\left\\lbrack \\begin{array}{c}\n\\textrm{pr}\\\\\n\\textrm{po}\n\\end{array}\\right\\rbrack =\\left\\lbrack \\begin{array}{c}\n\\textrm{angle}\\;\\textrm{de}\\;\\textrm{proue}\\\\\n\\textrm{angle}\\;\\textrm{de}\\;\\textrm{poupe}\n\\end{array}\\right\\rbrack \\;;\\;\\;\\;U=\\left\\lbrack \\begin{array}{c}\n\\delta h\\\\\n\\delta \\theta \n\\end{array}\\right\\rbrack \\;\\textrm{et}\\;\\;Y=\\left\\lbrack \\begin{array}{c}\n\\delta \\textrm{pr}\\\\\n\\delta \\textrm{po}\n\\end{array}\\right\\rbrack${"editStyle":"visual"}
%[text] 
%[text] ### **1.  Modèle dans l'espace d'état pour le point de fonctionnement : 6 noeuds** 
%[text] Nous choisissons de travail avec le modèle d'état du système dans les conditions opératoires correspondant à un vitesses de 6 noeuds. 
%[text] Et nous nous proposons donc d'analyser le système dans ces conditions afin d'en déduire ses propiétés fondamentale telles que la **commandabilité**, l'**observabilité**, la **stabilité, etc.** 
% 6 noeuds 
a11 = -0.038006; a12 = 0.89604; a14 = 0.0014673;
a21 = 0.0017105; a22 = -0.091676; a24 = -0.0056095;
a34 = -3.0867; b11 = -0.007542; b12 = -0.022859;
b21 = 0.0017323; b22 = -0.0022217;
A = [ a11 a12 0 a14; 
      a21 a22 0 a24;
      1   0   0 a34;
      0   1   0   0];
B = [ b11 b12;
      b21 b22;
      0    0 ;
      0    0 ];
C = [0 0 1 0;
     0 0 0 1];
D = [0 0;
     0 0];
syst = ss(A,B,C,D);




%%
%% Commandability et observability
Qc = ctrb(A,B);
Qo = obsv(A,C);

rc = rank(Qc) %[output:4b05a88d]
ro = rank(Qo) %[output:647e83d5]
%[text] On a les matrices de commandabilité et d'observabilité de Kalman ayant chacune un rang égale à la dimemension de la matrice de dynamique $A,${"editStyle":"visual"} ce qui nous permet de conclure que les système est à la fois **commandable** et **observable**.
%[text] On s'intéresse maintenant à l'étude de la stabilité du système, en traçant les pôles pole du système dans le plan complexe. 
pzmap(syst); grid on %[output:8d69c8ef]
damp(syst) %[output:853ff7f7]
%[text] On tous les pôles du système en boucle ouverte sont dans le démi plan complexe gauche, sauf un qui est à l'origine donc en limite de stabilité; ce qui rend le système instable. Tous les pôles sont réel, ce qui informe sur le fait que la réponse de sustème ne sera pas oscillatoire. 
% Step response 
stepplot(syst); grid on ; %[output:336af87a]
%%
%[text] on constate que le chacune des entrée affecte les deux sorties du système, ce qui permet de conclure sur l'existence d'un couplage dans le système
 impulse(syst); grid on; %[output:54dd79a4]
%[text] une augmentation de pr entraine une diminution notable de h et theta et une augmentation de po entraine l'augmentation de h et theta 
%%
%[text] ## Objective de performances
%[text] L'idée étant de placer les pôles de sorte à découplé le système, on place les pôles propres $\\lambda\_1${"editStyle":"visual"} et $\\lambda\_3${"editStyle":"visual"} pour avoir un comportement de premier ordre de dénominateur $\\left(p+\\lambda\_i \\right)${"editStyle":"visual"}. 
%[text] Sachant que le temps de réponse d'un premier ordre est $t\_{\\textrm{r5}%} =3\*\\tau \\;${"editStyle":"visual"} avec $\\tau =\\frac{1}{\\lambda }${"editStyle":"visual"} 
%[text] Pour garantir la stabilité, on impose que les pôles $\\lambda\_i \\;${"editStyle":"visual"}soit à partie réelle négative. 
%[text] 
%[text] ## **Structure propre et commande découplant**
%[text] Pour le découplage on souhaite transformer le système avec des état intermediaires qui n'ont pas nécessairement une signification physique, mais qui néanmoins permettrons de pouvoir synthétiser une loi de commande par retour d'état $U=-K\\;X+{H\\;Y}\_c${"editStyle":"visual"}. On note $V\\;${"editStyle":"visual"}la matrice de transformation  telle que $x=V\\;x^\* \\;\\;${"editStyle":"visual"}
%[text] le système découplé s'écrit alors : $\\left\\lbrace \\begin{array}{ll}\n\\dot{\\;\\;\\;x^\* \\;} =V^{-1} \\left(A-\\textrm{BK}\\right)V\\;x^\* +V^{-1} B\\;H\\;Y\_c \\; & \\\\\ny=C\\;V\\;x^\*  & \n\\end{array}\\right.${"editStyle":"visual"}  $y=\\left\\lbrack \\begin{array}{c}\ny\_1 \\\\\ny\_2 \n\\end{array}\\right\\rbrack =\\left\\lbrack \\begin{array}{c}\nh\\\\\n\\theta \n\\end{array}\\right\\rbrack${"editStyle":"visual"}
%[text] Sachant que l'on veut avoir la consigne $y\_{\\textrm{c1}} \\;${"editStyle":"visual"}qui n'agit que sur les état intermediaires $x\_3^\* \\;\\;\\textrm{et}\\;\\;x\_4^\*${"editStyle":"visual"} et $y\_{\\textrm{c2}} \\;${"editStyle":"visual"}qui n'agit que sur les état intermediaires $x\_1^\* \\;\\;\\textrm{et}\\;\\;x\_2^\*${"editStyle":"visual"} 
%[text] $\\left\\lbrack \\begin{array}{c}\n{\\dot{x\_1 } }^\* \\\\\n{\\dot{x\_2 } }^\* \\\\\n{\\dot{x\_3 } }^\* \\\\\n{\\dot{x\_4 } }^\* \n\\end{array}\\right\\rbrack =\\left\\lbrack \\begin{array}{cccc}\n\\lambda\_1  & 0 & 0 & 0\\\\\n0 & \\lambda\_2  & 0 & 0\\\\\n0 & 0 & \\lambda\_3  & 0\\\\\n0 & 0 & 0 & \\lambda\_4 \n\\end{array}\\right\\rbrack \\left\\lbrack \\begin{array}{c}\nx\_1^\* \\\\\nx\_2^\* \\\\\nx\_3^\* \\\\\nx\_4^\* \n\\end{array}\\right\\rbrack +\\left\\lbrack \\begin{array}{cc}\n0 & \*\_1 \\\\\n0 & \*\_2 \\\\\n\*\_3  & 0\\\\\n\*\_4  & 0\n\\end{array}\\right\\rbrack \\left\\lbrack \\begin{array}{c}\ny\_{\\textrm{c1}} \\\\\ny\_{\\textrm{c2}} \n\\end{array}\\right\\rbrack${"editStyle":"visual"}
%[text] On souhaite avoir  $\\begin{array}{l}\ny\_1 \\longrightarrow \\left\\lbrack x\_3^\* \\;\\;\\;\\;\\;\\;\\;\\;\\;x\_4^\* \\;\\;\\right\\rbrack \\;\\\\\ny\_2 \\longrightarrow \\left\\lbrack x\_1^\* \\;\\;\\;\\;\\;\\;\\;\\;\\;x\_2^\* \\;\\;\\right\\rbrack \n\\end{array}${"editStyle":"visual"}, $\\begin{array}{l}\n\\textrm{avec}\\;\\;y=\\left\\lbrack \\begin{array}{cccc}\n0 & 0 & 1 & 0\\\\\n0 & 0 & 0 & 1\n\\end{array}\\right\\rbrack V\\left\\lbrack \\begin{array}{c}\nx\_1^\* \\\\\nx\_2^\* \\\\\nx\_3^\* \\\\\nx\_4^\* \n\\end{array}\\right\\rbrack \\;\\textrm{donc}\\;\\textrm{aura}\\;y=\\left\\lbrack \\begin{array}{cccc}\n0 & 0 & 1 & 0\\\\\n0 & 0 & 0 & 1\n\\end{array}\\right\\rbrack \\left\\lbrack \\begin{array}{cccc}\n\* & \* & \* & \*\\\\\n\* & \* & \* & \*\\\\\n0 & 0 & \* & \*\\\\\n\* & \* & 0 & 0\n\\end{array}\\right\\rbrack \\left\\lbrack \\begin{array}{c}\nx\_1^\* \\\\\nx\_2^\* \\\\\nx\_3^\* \\\\\nx\_4^\* \n\\end{array}\\right\\rbrack \\;\\;\\;=\\left\\lbrack \\begin{array}{cccc}\n0 & 0 & v\_{33}  & v\_{34} \\\\\nv\_{41}  & v\_{42}  & 0 & 0\n\\end{array}\\right\\rbrack \\left\\lbrack \\begin{array}{c}\nx\_1^\* \\\\\nx\_2^\* \\\\\nx\_3^\* \\\\\nx\_4^\* \n\\end{array}\\right\\rbrack \\;\\\\\n{\\;y}\_1 =v\_{33} x\_3^\* +v\_{34} x\_4^\* \\\\\n{\\;y}\_2 =v\_{41} x\_1^\* +v\_{42} x\_2^\* \n\\end{array}${"editStyle":"visual"}
lamda1=-3/100;
lamda2=lamda1*100;
lamda3=-3/80;
lamda4=lamda3*100;

Nlamda2=-inv(lamda2*eye(4,4)-A)*B;
Nlamda1=-inv(lamda1*eye(4,4)-A)*B;
Nlamda3=-inv(lamda3*eye(4,4)-A)*B;
Nlamda4=-inv(lamda4*eye(4,4)-A)*B;


v1_tilde = [0;
            1];
v2_tilde = [0;
            1];
v3_tilde = [1;
            0];
v4_tilde = [1;
            0];

Nlamda3_tilde = Nlamda3(3:4,:);
Nlamda1_tilde = Nlamda1(3:4,:);
Nlamda2_tilde = Nlamda2(3:4,:);
Nlamda4_tilde = Nlamda4(3:4,:);

z1 = inv(Nlamda1_tilde'*Nlamda1_tilde)*transpose(Nlamda1_tilde)*v1_tilde;
z2 = inv(Nlamda2_tilde'*Nlamda2_tilde)*transpose(Nlamda2_tilde)*v2_tilde;
z3 = inv(Nlamda3_tilde'*Nlamda3_tilde)*transpose(Nlamda3_tilde)*v3_tilde;
z4 = inv(Nlamda4_tilde'*Nlamda4_tilde)*transpose(Nlamda4_tilde)*v4_tilde;

v1 = Nlamda1*z1;
v2 = Nlamda2*z2;
v3 = Nlamda3*z3;
v4 = Nlamda4*z4;

V = [v1 v2 v3 v4]

Z = [z1 z2 z3 z4];

K = Z*inv(V)
%[text] On s'interesse maintenant au calcul de la matrice de **précommande** H
%[text] On a $U=V^{-1} \\;\\;\\Rightarrow \\;U\\;B\\;H=\\left\\lbrack \\begin{array}{cc}\n0 & \*\_1 \\\\\n0 & \*\_2 \\\\\n\*\_3  & 0\\\\\n\*\_4  & 0\n\\end{array}\\right\\rbrack \\Rightarrow H={\\left({\\;\\left(U\\ldotp B\\right)}^{\\prime } \\ldotp \\left(U\\ldotp B\\right)\\right)}^{-1} \\ldotp {\\left(U\\ldotp B\\right)}^{\\prime } \\ldotp \\left\\lbrack \\begin{array}{cc}\n0 & \*\_1 \\\\\n0 & \*\_2 \\\\\n\*\_3  & 0\\\\\n\*\_4  & 0\n\\end{array}\\right\\rbrack \\;${"editStyle":"visual"}
%[text] On a le système découplé qui s'écrit comme suit : 
%[text] $\\left\\lbrack \\begin{array}{c}\n{\\dot{x\_1 } }^\* \\\\\n{\\dot{x\_2 } }^\* \\\\\n{\\dot{x\_3 } }^\* \\\\\n{\\dot{x\_4 } }^\* \n\\end{array}\\right\\rbrack =\\left\\lbrack \\begin{array}{cccc}\n\\lambda\_1  & 0 & 0 & 0\\\\\n0 & \\lambda\_2  & 0 & 0\\\\\n0 & 0 & \\lambda\_3  & 0\\\\\n0 & 0 & 0 & \\lambda\_4 \n\\end{array}\\right\\rbrack \\left\\lbrack \\begin{array}{c}\nx\_1^\* \\\\\nx\_2^\* \\\\\nx\_3^\* \\\\\nx\_4^\* \n\\end{array}\\right\\rbrack +\\left\\lbrack \\begin{array}{cc}\n0 & \*\_1 \\\\\n0 & \*\_2 \\\\\n\*\_3  & 0\\\\\n\*\_4  & 0\n\\end{array}\\right\\rbrack \\left\\lbrack \\begin{array}{c}\ny\_{\\textrm{c1}} \\\\\ny\_{\\textrm{c2}} \n\\end{array}\\right\\rbrack \\longrightarrow \\left\\lbrace \\begin{array}{l}\n{\\dot{x\_1 } }^\* =\\lambda\_1 x\_1^\* +\*\_1 y\_{\\textrm{c2}} \\;\\\\\n{\\dot{x\_2 } }^\* =\\lambda\_2 x\_2^\* +\*\_2 y\_{\\textrm{c2}} \\\\\n{\\dot{x\_3 } }^\* =\\lambda\_3 x\_3^\* +\*\_3 y\_{\\textrm{c1}} \\\\\n{\\dot{x\_4 } }^\* =\\lambda\_4 x\_4^\* +\*\_4 y\_{\\textrm{c1}} \n\\end{array}\\right.${"editStyle":"visual"} 
%[text] dans le domaine de Laplace on aura : $\\left\\lbrace \\begin{array}{l}\nx\_1^\* \\left(p\\right)={\\frac{\*\_1 }{p-\\lambda\_1 }} y\_{\\textrm{c2}} \\;\\\\\nx\_2^\* \\left(p\\right)={\\frac{\*\_2 }{p-\\lambda\_2 }} y\_{\\textrm{c2}} \\\\\nx\_3^\* \\left(p\\right)={\\frac{\*\_3 }{p-\\lambda\_3 }} y\_{\\textrm{c1}} \\\\\nx\_4^\* \\left(p\\right)={\\frac{\*\_4 }{p-\\lambda\_4 }} y\_{\\textrm{c1}} \n\\end{array}\\right.${"editStyle":"visual"} avec $y=\\left\\lbrack \\begin{array}{c}\ny\_1 \\\\\ny\_2 \n\\end{array}\\right\\rbrack =\\left\\lbrack \\begin{array}{cccc}\n0 & 0 & v\_{33}  & v\_{34} \\\\\nv\_{41}  & v\_{42}  & 0 & 0\n\\end{array}\\right\\rbrack \\left\\lbrack \\begin{array}{c}\nx\_1^\* \\\\\nx\_2^\* \\\\\nx\_3^\* \\\\\nx\_4^\* \n\\end{array}\\right\\rbrack \\;${"editStyle":"visual"}
%[text] Pour avoir un ordre d'idée sur les valeurs des élément des la matrice de précommande $H${"editStyle":"visual"} on pourrait poser :
%[text]  $\\left\\lbrace \\begin{array}{l}\ny\_1 =v\_{33} x\_3^\* +v\_{34} x\_4^\* \\\\\ny\_2 =v\_{41} x\_1^\* +v\_{42} x\_2^\* \n\\end{array}\\right.\\Longrightarrow \\left\\lbrace \\begin{array}{l}\ny\_1 =\\left(v\_{33} {\\frac{\*\_3 }{p-\\lambda\_3 }} +v\_{34} {\\frac{\*\_4 }{p-\\lambda\_4 }} \\right)y\_{\\textrm{c1}} \\\\\ny\_2 =\\left(v\_{41} \\frac{\*\_1 }{p-\\lambda\_1 }+v\_{42} {\\frac{\*\_2 }{p-\\lambda\_2 }} \\right)y\_{\\textrm{c2}} \n\\end{array}\\right.\\;${"editStyle":"visual"}
%[text] donc en régime permant pour avoir un gain statique unitaire, on devrait avoir $\\left\\lbrace \\begin{array}{l}\n\\left(v\_{33} {\\frac{\*\_3 }{-\\lambda\_3 }} +v\_{34} {\\frac{\*\_4 }{-\\lambda\_4 }} \\right)=1\\\\\n\\left(v\_{41} \\frac{\*\_1 }{-\\lambda\_1 }\\;+v\_{42} {\\frac{\*\_2 }{-\\lambda\_2 }} \\right)=1\n\\end{array}\\right.${"editStyle":"visual"} 
%[text] on considère pour une premier test $\*\_2 =0\\;\\textrm{et}{\\;\\;\*}\_4 =0${"editStyle":"visual"} afin de ne garder que les états les plus influents 
%[text] ce qui nous donne : $\\left\\lbrace \\begin{array}{l}\n\*\_3 =-\\frac{\\lambda\_3 }{v\_{33} }\\\\\n\*\_1 =-\\frac{\\lambda\_1 }{v\_{41} }\n\\end{array}\\right.${"editStyle":"visual"}
%[text] 
%[text] $H=\\left\\lbrack \\begin{array}{cc}\nh\_1  & h\_2 \\\\\nh\_3  & h\_4 \n\\end{array}\\right\\rbrack${"editStyle":"visual"}
%[text] Avec 
UB=inv(V)*B;
UB_inv = inv(UB'*UB);
UB_inter = UB_inv*UB';
star1 =  -lamda1/V(4,1);%(1/5.48)*1/(3*V(4,1));
star2 = 0; %-lamda2*1*0/V(4,2);
star3 = -lamda3/V(3,3); % (1/13.19)*1/V(3,3);
star4 = 0; %-lamda4*1*0.5/V(3,4);
h1 = UB_inter(1,3)*star3 + UB_inter(1,4)*star4; h2 = UB_inter(1,1)*star1 + UB_inter(1,2)*star2;
h3 = UB_inter(2,3)*star3 + UB_inter(2,4)*star4; h4 = UB_inter(2,1)*star1 + UB_inter(2,2)*star2;
H=[h1 h2;h3 h4]
Abf=(A-B*K);
Bbf= B*H;
sys=ss(Abf,Bbf,C,0);
stepplot(sys); grid on; %[output:7a06cbce]
%[text] A la simulation on constate que le système est bien découplé, mais gain statique pour les deux sorties sont de $\\frac{1}{2}${"editStyle":"visual"} au lieu de 1. Nous multiplions alors nos $\*\_1 \\;\\textrm{et}\*\_{3\\;} \\;\\textrm{par}\\;2${"editStyle":"visual"}
UB=inv(V)*B;
UB_inv = inv(UB'*UB);
UB_inter = UB_inv*UB';
star1 =  -lamda1*2/V(4,1);%(1/5.48)*1/(3*V(4,1));
star2 = 0; %-lamda2*1*0/V(4,2);
star3 = -lamda3*2/V(3,3); % (1/13.19)*1/V(3,3);
star4 = 0; %-lamda4*1*0.5/V(3,4);
h1 = UB_inter(1,3)*star3 + UB_inter(1,4)*star4; h2 = UB_inter(1,1)*star1 + UB_inter(1,2)*star2;
h3 = UB_inter(2,3)*star3 + UB_inter(2,4)*star4; h4 = UB_inter(2,1)*star1 + UB_inter(2,2)*star2;
H=[h1 h2;h3 h4]
Acl=(A-B*K);
Bcl= B*H;
sys=ss(Acl,Bcl,C,0);
stepplot(sys); grid on; linewidth = 2; %[output:00c2668e]

%[text] Cette fois on bien le système qui répond aux objectifs de performance que l'on s'est fixer au départ, notamment les temps de réponse 80 et 100 pour les deux sorties respectivement $y\_1 \\;\\textrm{et}\\;\\;y\_2${"editStyle":"visual"}. Des gain statique unitaire pour les deux sortie, et un découplage parfait. 
%[text] A travers une démarche heuristique nous avons pu déterminer les bonnes valeurs pour les étoiles afin calculer la matrice de précommande qui nous à donné un découplage presque parfait
%[text] ## 
%[text] ## Decouplage en mode statique
%[text] Afin d'avoir un découplage parfait, on se ramène en régime statique avec $\\dot{x} =0${"editStyle":"visual"} et on exprime la consigne de la forme$Y\_c =C\\;x${"editStyle":"visual"}
%[text] On montre que la matrice de précommande peut se déduire de la relation $H=\\Omega\_{22} +K\\;\\Omega\_{12}${"editStyle":"visual"}
%[text] Avec $\\Omega =\\left\\lbrack \\begin{array}{cc}\n\\Omega\_{11}  & \\Omega\_{12} \\\\\n\\Omega\_{21}  & \\Omega\_{22} \n\\end{array}\\right\\rbrack ={\\left\\lbrack \\begin{array}{cc}\nA & B\\\\\nC & 0\n\\end{array}\\right\\rbrack }^{-1}${"editStyle":"visual"}
Omega_inv = [A        B;
             C   zeros(2,2)];
Omega = inv(Omega_inv);
H = Omega(5:6,5:6) + K*Omega(1:4,5:6)
syst_static_decoupled = ss(Abf,B*H,C,0);
stepplot(syst_static_decoupled); grid on; %[output:9c6636a0]
%[text] On a le système bien découplé avec des gains statique unitaire et les dynamique souhaité. Ce qui permet de conclure sur l'efficacité 
%[text] de l'approche du découplage en mode statique. 
%[text] ## Intensive mode placement
%[text] Dans cette partie nous allons nous servir de la méthode $\\textrm{place}\\;\\textrm{de}\\;\\textrm{Matlab}${"editStyle":"visual"} pour calculer les gains du rétour d'état permettant de faire une 
%[text] placement de pôles du système. Elle vérifie ainsi la commandabilité du système en s'assurant de la matrice de commandabilité de 
%[text] Kalman  $Q\_c =\\left\\lbrack B\\;\\textrm{AB}\\;A^2 B\\;\\ldotp \\ldotp \\ldotp \\right\\rbrack \\;${"editStyle":"visual"}est de rank plein. Ensuite elle calcul le élément de la matrice de gain K.
%[text] La matrice de gain K n'est pas nécessairement unique. En effet dans dans le cas d'un système multi-entrée où la matrice B a plus d'une 
%[text] colonne, il peut y avoir plusieurs combinaisons de gains K qui permettent de placer les poles du système en boucle fermée au endroits 
%[text] désirés. Ce n'est que dans le cas de système à une entrée que la matrice de gain K est unique. 
%[text] 
%[text] Pour calculer les gains K avec une sensibilité minimale deux aspect sont à prende en compte. Premièrement, il faut placer les pôles les 
%[text] plus loin possibles les uns des autres pour éviter qu'une pétite variation du système ne cause une garde variation des gain de retour d'état K.  
%[text] En second lieu, il convient de rester dans les limite de dynamique en prenent pas de pôles à partie réelles trop négatives et aussi pour une 
%[text] question de robustesse, les éloigné le plus possible de l'axe imaginaire et de 0.
%%
Poles = [lamda1; lamda2;lamda3; lamda4] %[output:0f97bc0e]
K = place(A,B,Poles);
Abf= A-B*K;
syst_mode_placement = ss(Abf,B,C,0);
stepplot(syst_mode_placement); grid on; %[output:2dd4070c]

%[text] On constate que la contrainte de découplage n'est pas satisfaite car le système n'est pas complètement découplé. Par contre les temps de réponse de sont bien respecté, pour la sortie y1 à environ 80 secondes et la sortie y2 à environ 100 secondes. Les gain statique non plus ne sont pas unitaire, ce qui peut également se comprendre vue que notre les gain K n'imposent que la dynamique du système et pour ajuster les gains statiques il faudrait calculer une matrice de précommande H permettant d'y parvenir.
%[text] 
%[text] Pour ce faire, nous décidons donc de reprendre la matrice de précommande calculée dans avec le découplage en mode 
%[text] statique. 
Bp = B*H;
syst_mode_placement = ss(Abf,Bp,C,0);
stepplot(syst_mode_placement); grid on; %[output:495fb839]
%[text] On constate cette fois-ci quel système est découplé avec aussi des gain statique unitaire, ce qui s'explique par le fait que 
%[text] la matrice de précommande H a été déterminer avec prise en compte de ce critère.
%[text] ## Etude de sensibilité
%[text] La fonction cond.m de Matlab permet d'analyser le conditionnement numérique. Elle reçoit en entrée une matrice et renvoie une valeur 
%[text] indiquant la sensibilité de la matrice. 
%[text] - Si la sensibilité est de faible valeur, alors la matrice bien conditionnée, 
%[text] - Si la sensibilité est élevée, alors la matrice est mal conditionnée, donc instable au variation numériquement. \
%[text] On se propose d'évaluer la sensibilité du système obtenu par placement de pôles:
Abf = A - B*K;
[V, D] = eig(Abf);
sensibilite = cond(V);
disp('Sensitivité du placement de mode :'); disp(sensibilite); %[output:75084f46]
%[text] Pour le placement de structure propre : 
[V, D] = eig(Acl);
sensibilite = cond(V);
disp('Sensitivité du placement de structure propre :'); disp(sensibilite); %[output:901343e2]
%%

%[text] **Etude du fonctionnement en mode dégradé (en mono-entée):** 
%[text] - $U\_1 \\;\\;\\textrm{inactive};U\_{2\\;} \\;\\textrm{active}${"editStyle":"visual"} \
%[text] On reduit simplement la matrice B en enlevant sa première colonne:
B2 = B(:,2);
Poles = [lamda1; lamda2;lamda3; lamda4];
K2 = place(A,B2,Poles);
stepplot(ss(A-B2*K2,B2,C,0)); grid on; %[output:588c6ae7]
[V, D] = eig(A-B2*K2);
sensibilite = cond(V);
disp('Sensitivité en mode dégradé (U_1 inactive) :'); disp(sensibilite); %[output:76043528]
%[text] - $U\_2 \\;\\;\\textrm{inactive};U\_{1\\;} \\;\\textrm{active}${"editStyle":"visual"} \
% B1 = [B(:,1) 0*B(:,2)]
B1 = B(:,1);
Poles = [lamda1; lamda2; lamda3; lamda4];
K1 = place(A,B1,Poles) %[output:5540fbbc]
stepplot(ss(A-B1*K1,B1,C,0)); grid on; %[output:169be248]
[V, D] = eig(A-B1*K1);
sensibilite = cond(V);
disp('Sensitivité en mode dégradé (U_2 inactive) :');  %[output:9fcf50d8]
disp(sensibilite); %[output:8e6819db]
%[text] On constate que le fonctionnement en mode dégradé rend le système beaucoup plus sensible, tandis qu'en mode nominal, il est nettement moins sensible. Une des raisons principales est la perte d'un degré de liberté pour commander le système. Même si le système est couplé, l'action d'une seule entrée ne suffit pas toujours à rendre le système robuste, car elle limite la capacité à contrôler efficacement toutes les dynamiques du système.

